interface IIcon {
  size: number
  color: string
  rotate: number
  mt: string
  mr: string
  mb: string
  ml: string
}

const Container = styled.span<IIcon>(
  ({ size, rotate, mt, mr, mb, ml }) => css`
    display: flex;
    align-items: center;
    justify-content: center;
    width: 100%;
    max-width: ${size}px;
    height: ${size}px;
    transform: rotate(${rotate}deg);
    margin-top: ${mt};
    margin-right: ${mr};
    margin-bottom: ${mb};
    margin-left: ${ml};
  `,
)
